import React, { Component } from 'react';
import {BrowserRouter as Router, Switch, Route, Link} from 'react-router-dom';
import Nav from './components/Nav';
import Footer from './components/Footer';
import Home2 from './components/Home2';
import About2 from './components/About2';
import Contact2 from './components/Contact2';
import ProjectDetail from './components/ProjectDetail';
import ParticlesComponent from './components/ParticlesComponent';

import './styles/base.scss';


// const logo = require('./images/sass_logo.png');//for reusability

class App extends Component {
  render() {
    return (
    <Router>
      <div
        style={{
          position: "absolute",
          top: 0,
          left: 0,
          width: "100%",
          height: "100%"
        }}
      >
        <ParticlesComponent />
        <div
          style={{
            position: "absolute",
            top: 0,
            left: 0,
            width: "100%",
            height: "100%"
          }}
        >
          {/* You can render <Route> and <NavTabs /> here */}
          <Nav/>        
          <Switch>
              <Route exact path='/' component={Home2} />
              <Route path='/contact' component={Contact2} />
              <Route path='/about' component={About2} />
              <Route path="/project" component={ProjectDetail}/>
              {/* <Route path="/link/:id" component={ProjectDetail}/> */}
              <Route path="/:id" component={Child} />
              <Route
          path="/order/:direction(asc|desc)"
          component={ComponentWithRegex}
        />
          </Switch>
          <Footer/>
        </div>
      </div>
    </Router>
    );
  }
}
function Child({ match }) {
  return (
    <div>
      <h3>ID: {match.params.id}</h3>
    </div>
  );
}
function ComponentWithRegex({ match }) {
  return (
    <div>
      <h3>Only asc/desc are allowed: {match.params.direction}</h3>
    </div>
  );
}

export default App;
